const A="Microbiology Chapter 17 Homework",I="Homework questions for Microbiology Chapter 17.",g="Microbiology",C=[{id:"mc-ch17-hw-1",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 17",topic:"Innate Immunity",difficulty:"easy",question:"Innate immunity is selective.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Innate immunity is non-specific, meaning it acts as a general defense against all pathogens, unlike adaptive immunity which is highly specific."},{id:"mc-ch17-hw-2",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 17",topic:"Innate Immunity",difficulty:"easy",question:"An acquired response comes before an innate response.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. The innate immune response is the body's first line of defense and is activated immediately upon pathogen exposure. The acquired (or adaptive) response develops later."},{id:"mc-ch17-hw-3",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 17",topic:"Innate Immunity",difficulty:"easy",question:"Lysozymes are not located in your tears.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Lysozyme is an enzyme found in tears, saliva, mucus, and other bodily fluids that breaks down the cell walls of bacteria, acting as a key component of the innate immune system."},{id:"mc-ch17-hw-4",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 17",topic:"Innate Immunity",difficulty:"medium",question:"The step immediately following this one is the release of histamine.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. The image likely depicts the binding of an allergen to an antibody on a mast cell. This triggers the degranulation of the mast cell and the release of histamine and other inflammatory mediators."},{id:"mc-ch17-hw-5",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 17",topic:"Innate Immunity",difficulty:"easy",question:"Interferon interferes with viral replication.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Interferons are signaling proteins released by host cells in response to the presence of viruses. They trigger nearby cells to heighten their anti-viral defenses, thus interfering with viral replication and spread."}],v={name:A,description:I,subject:g,questions:C};export{v as default,I as description,A as name,C as questions,g as subject};
